  \"2016-03-04T21:38:30.522233\",\n\t\"name\": \"initial-survey-instructions-for-columbian-white-tailed-deer-body-condition-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Refuge actively manages deer habitat
  through pasture enhancement, tree planting, and cattle grazing, however, we have
  few tools to directly measure the effects of this management on deer health.  Until
  now, we have conducted habitat management and then waited to see if the population
  responded.  In addition, it is difficult to compare the reasons for differing productivity
  between subpopulations.  Periodic checks of body condition allow for a better measure
  of habitat conditions as they relate to deer.  This method can also be used to assess
  habitat capacity to give an indication of whether the area could support more deer
  in the future or whether a decline is likely to occur.  In addition, the capture
  of deer allows the Refuge to attach GPS transmitters that will track habitat use
  and inform the Refuge on how management practices are affecting the use of managed
  areas.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
